import React, {useState} from 'react';
import './App.css';

//components
import Toolbar from '../src/components/Toolbar/Toolbar'
import SideDrawer from './components/SideDrawer/SideDrawer';
import Backdrop from './components/Backdrop/Backdrop';

function App() {

  const [sideDrawerOpened, setSideDrawer] = useState(false);

  return (
    <div className="App">
      <Toolbar click={(prevState) => setSideDrawer(!sideDrawerOpened)}/>
      <SideDrawer sideDrawerOpened={sideDrawerOpened}/>
      {sideDrawerOpened ? <Backdrop/> : null}
      <p>this is the example text</p>
    </div>
  );
}

export default App;
